import React, { useState } from 'react';
import { StyleSheet, Text, View, TouchableOpacity, Animated, Image, Platform } from 'react-native';
import Ionicons from 'react-native-vector-icons/Ionicons';
import MapView, { Marker } from 'react-native-maps'; // Pour mobile
import { MapContainer, TileLayer, Marker as LeafletMarker, Popup } from 'react-leaflet'; // Pour web
import 'leaflet/dist/leaflet.css'; // Nécessaire pour le style de Leaflet

export default function Home({ navigation }) {
  const [activeTab, setActiveTab] = useState('home'); // État pour suivre l'onglet actif
  const [animation] = useState({
    home: new Animated.Value(0),
    notifications: new Animated.Value(0),
    profil: new Animated.Value(0),
  });

  const handleTabPress = (tab) => {
    setActiveTab(tab);

    // Lancer l'animation pour le tab actif
    Animated.timing(animation[tab], {
      toValue: 1,
      duration: 300,
      useNativeDriver: false,
    }).start();

    // Réinitialiser les autres animations
    Object.keys(animation).forEach((key) => {
      if (key !== tab) {
        Animated.timing(animation[key], {
          toValue: 0,
          duration: 300,
          useNativeDriver: false,
        }).start();
      }
    });

    if (tab === 'profil') {
      navigation.navigate('Profil');
    }
  };

  const getBarColor = (tab) => {
    return animation[tab].interpolate({
      inputRange: [0, 1],
      outputRange: ['#fff', '#000'], // Blanc au repos, bleu actif
    });
  };

  return (
    <View style={styles.container}>
      <Image source={require('../../assets/realvitalogo.png')} style={styles.logo} />
      <Text style={styles.title}>Vitamap</Text>
      <Ionicons name="menu-outline" size={20} color="#fff" style={{ position: 'absolute', top: 10, right: 20 }} />
      <Ionicons name="arrow-back-outline" size={20} color="#fff" style={{ position: 'absolute', top: 10, left: 20 }} />

      {/* Affichage conditionnel de la carte */}
      {Platform.OS === 'web' ? (
        <View style={styles.map}>
          <MapContainer
            center={[46.603354, 1.888334]} // Coordonnées initiales
            zoom={6}
            style={{ height: '100%', width: '100%' }}
          >
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
            <LeafletMarker position={[48.8566, 2.3522]}>
              <Popup>Paris - Capitale de la France</Popup>
            </LeafletMarker>
          </MapContainer>
        </View>
      ) : (
        <MapView
          style={styles.map}
          initialRegion={{
            latitude: 46.603354,
            longitude: 1.888334,
            latitudeDelta: 10,
            longitudeDelta: 10,
          }}
          showsUserLocation={true}
          showsMyLocationButton={true}
        >
          <Marker
            coordinate={{ latitude: 48.8566, longitude: 2.3522 }}
            title="Paris"
            description="Capitale de la France"
          />
        </MapView>
      )}

      <View style={styles.bottomMenu}>
        <TouchableOpacity style={styles.menuButton} onPress={() => handleTabPress('home')}>
          <Ionicons name="home-outline" size={20} color={activeTab === 'home' ? '#24a0ed' : '#fff'} />
          <Animated.View style={[styles.whiteBar, { backgroundColor: getBarColor('home') }]} />
        </TouchableOpacity>

        <TouchableOpacity style={styles.menuButton} onPress={() => handleTabPress('notifications')}>
          <Ionicons name="notifications-outline" size={20} color={activeTab === 'notifications' ? '#24a0ed' : '#fff'} />
          <Animated.View style={[styles.whiteBar, { backgroundColor: getBarColor('notifications') }]} />
        </TouchableOpacity>

        <TouchableOpacity style={styles.menuButton} onPress={() => handleTabPress('profil')}>
          <Ionicons name="person-outline" size={20} color={activeTab === 'profil' ? '#24a0ed' : '#fff'} />
          <Animated.View style={[styles.whiteBar, { backgroundColor: getBarColor('profil') }]} />
        </TouchableOpacity>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'rgba(24, 212, 115, 0.88)',
    alignItems: 'center',
    justifyContent: 'flex-start',
  },
  title: {
    fontSize: 24,
    marginBottom: 8,
    color: '#fff',
    fontWeight: 'bold',
  },
  map: {
    width: '100%',
    height: '85%',
  },
  bottomMenu: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    backgroundColor: 'rgba(24, 212, 115, 0.88)',
    width: '100%',
    height: 60,
    borderTopWidth: 1,
    borderTopColor: '#ddd',
  },
  menuButton: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  whiteBar: {
    marginTop: 5,
    width: '100%',
    height: 3,
    borderRadius: 2,
  },
  logo: {
    width: 50,
    height: 50,
  },
});
